script: |
  super -f text -I q5306.spq | sort > q5306.out

inputs:
  - name: q5306.spq
    data: |
      SELECT - col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE 52 * + col2 BETWEEN + - col1 AND - + col2 * ( - col2 );
  - name: tab1

outputs:
  - name: q5306.out
    data: |
      -59
      -68
      -96
